import { View, Text, SafeAreaView, StyleSheet } from "react-native";

 const App = () => {

  return(

         <SafeAreaView style={styles.wrapper}>
          <View style={styles.container}>

            <Text>UrbanFleet</Text>

          </View>

          </SafeAreaView>
  )
}

const styles = StyleSheet.create({
  wrapper:{
    flex: 1
  },
  container: {
    backgroundColor: 'lightgreen',
    alignItems: 'center'
  }
})

export default App
